import React, { useState } from "react";
import img from "../todo_img.png";

const Todo = () => {
  const [inputData, setInputData] = useState("");
  const [items, setItems]= useState([]);

  const addItem = () => {
    setItems(inputData);
  }

  return (
    <>
      <div className="main-div">
        <div className="child-div">
          <figure className="fig_div">
            <img className="img_div" src={img} alt="todo_img" />
            <figcaption>Add Your List Here</figcaption>
          </figure>

          <div className="addItems">
            <input
              type="text"
              placeholder="✍️ Add Items..."
              value={inputData}
              onChange={(e) => setInputData(e.target.value)}
            />
            <span className="material-symbols-outlined" title="Add Item" onClick={addItem}>
              add
            </span>
          </div>

          <div className="showItems">
            <div className="eachItem">
              <h3>{items}</h3>
              <span
                className="material-symbols-outlined deleteItem"
                title="Delete Item"
              >
                delete
              </span>
            </div>
          </div>

          {/* clear all button */}
          <div className="showItems">
            <button className="btn effect04" data-sm-link-text="Remove All">
              <span> CHECK LIST </span>
            </button>
          </div>
        </div>
      </div>
    </>
  );
};

export default Todo;
